handpath=os.path.expandvars(r"%TEMP%\hand.png")
def write():
    for _ in ' ':
        button1.config(state=DISABLED)
        button2.config(state=DISABLED)
        button3.config(state=DISABLED)
        entry1.config(state=DISABLED)
        root.protocol("WM_DELETE_WINDOW", lambda x:...)
        statusBar.config(text="正在请求服务器...")
        if subprocess.call("ping www.baidu.com",stderr=subprocess.DEVNULL,stdout=subprocess.DEVNULL,stdin=subprocess.DEVNULL):
            statusBar.config(text="失败：服务器连接失败")
            messagebox.showerror("错误","服务器连接失败")
        statusBar.config(text="正在上传文件...")
        time.sleep(3)
        statusBar.config(text="正在识别问题...")
        t=0
        for x in range(homework.get_width()):
            for y in range(homework.get_height()):
                t+=homework.get_at((x,y))[0]
                t+=homework.get_at((x,y))[1]
                t+=homework.get_at((x,y))[2]
        time.sleep(2.2)
        if t<homework.get_width()*homework.get_height()*3*160:
            statusBar.config(text="错误：无法识别问题")
            messagebox.showerror("错误","无法识别问题")
            break
        statusBar.config(text="正在回答问题...")
        time.sleep(4)
        statusBar.config(text="正在生成笔迹...")
        time.sleep(2.2)
        statusBar.config(text="下载中...")
        time.sleep(1.7)
        statusBar.config(text="正在书写...")

        # threading.Thread(target=write_text,args=(screen,text,pygame.image.load(r"C:\Users\Admin\Documents\Writing256l.png"),0,209,80),kwargs={'ox':240,'oy':200,'width':8}).start()
        root.title("SB自动写作业")
        write_text(screen,text,pygame.image.load(handpath),0,209,80,ox=240,oy=200,width=8)
        statusBar.config(text="作业已完成")
        messagebox.showinfo("完成","作业已完成")
        button5.config(state=NORMAL)
    root.protocol("WM_DELETE_WINDOW", sys.exit)
    button1.config(state=NORMAL)
    button2.config(state=NORMAL)
    button3.config(state=NORMAL)
    entry1.config(state=NORMAL)
def start():
    threading.Thread(target=write).start()
filename=StringVar(value="")
def selectFile():
    fn=filedialog.askopenfilename(filetypes=[('图片文件', '*.jpg;*.png;*.jpeg;*.bmp;*.tif;*.tiff;*.ico'),('所有文件', '*')],title='选择作业图片')
    if fn:
        filename.set(fn)
        load_file()
def load_file():
    button5.config(state=DISABLED)
    if os.path.isfile(filename.get()):
        screen.fill(pygame.Color(127,127,127))
        global homework
        try:
            homework=pygame.image.load(filename.get())
            button3.config(state=NORMAL)
        except:
            messagebox.showerror("错误","无法加载图片")
            homework=pygame.Surface((1280,720))
            button3.config(state=DISABLED)
        screen.blit(pygame.transform.scale(homework,(1280,720)),(0,0))
        pygame.display.update()
    else:
        messagebox.showerror("错误","无效路径")
        return
