def write_text(surface:pygame.Surface,plist=text,hand=pygame.Surface((0,0)),hx=0,hy=0,scale=10,speed=.2,size=(16,5),ox=100,oy=100,width=3):
    b=pygame.Surface((size[0]*scale,size[1]*scale),depth=8)
    b.set_colorkey(1)
    b.fill(1)
    b.set_palette_at(0,(32,32,32))
    rs=surface.copy()
    for i in range(len(plist)):
        if i==0:continue
        x,y,w=plist[i-1]
        xt,yt,wt=plist[i]
        d=int((abs(x-xt)**2+abs(y-yt)**2)**.5/speed)
        for j in range(d):
            p=j/d
            px=(xt-x)*p
            py=(yt-y)*p
            if wt:pygame.draw.line(b,0,(x*scale,y*scale),(x*scale+px*scale,y*scale+py*scale),width)
            surface.blit(rs,(0,0))
            surface.blit(b,(ox,oy))
            surface.blit(hand,((x+px)*scale-hx+ox,(y+py)*scale-hy+oy))
            pygame.display.update()
            pygame.time.Clock().tick(60)
        if wt:pygame.draw.line(b,0,(x*scale,y*scale),(xt*scale,yt*scale),width)
